from math import gcd
def a(n, classes_so_far = []):
    largest_found = len(classes_so_far)
    lower = 1 if largest_found == 0 else classes_so_far[-1][0] + 1
    for new_n in range(lower, n + 1):
        for new_a in range(0, new_n):
            disjoint_all = True
            for ni, ai in classes_so_far:
                if (ai - new_a) % gcd(new_n, ni) == 0:
                    disjoint_all = False
            if disjoint_all:
                largest_found = max(largest_found, a(n, classes_so_far + [(new_n, new_a)]))
    return largest_found
